INSERT INTO `t_ntc` VALUES (2,'- What\'s new with BioStar 2.7.8','<B>Key Updates</B>\n<BR>\n<BR>- Enables users to search for visitors using fingerprints in the visit application page and VISITOR menu.\n<BR>- Supports user group synchronization in Active Directory.\n<BR>- Supports multiple use function of controllers.\n<BR>- Supports Anti-Tailgating.\n<BR>- Supports setting options for Wiegand authentication result output.\n<BR>- Supports options for selection by card type\n<BR>- Supports the fingerprint/face duplicate check when registering users on a device.\n<BR>- Stabilization & bug fixes (*Please refer to the revision note.)\n<BR>\n<BR>\n<B>주요 업데이트</B>\n<BR>\n<BR>- 방문 신청 페이지 및 방문자 메뉴에서 지문을 이용해 방문자를 검색할 수 있도록 지원\n<BR>- 액티브 디렉토리에 사용자 그룹 동기화 지원\n<BR>- 컨트롤러 중복 사용 기능 지원\n<BR>- 따라 들어가기 방지(Anti-Tailgating) 지원\n<BR>- Wiegand 인증 결과 출력 옵션 설정 지원\n<BR>- 카드 형식별 선택 옵션 지원\n<BR>- 장치에서 사용자 등록 시 중복 지문/얼굴 검사 지원\n<BR>- 안정화 및 버그 수정 (*리비전 노트 참조)\n<BR>','2019-08-08 12:46:38');
/*!40000 ALTER TABLE `t_ntc` ENABLE KEYS */;
UNLOCK TABLES;

